"use strict";(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[82],{6082:e=>{e.exports=JSON.parse('{"question":[{"id":1,"text":"When asked which emotion I\'m feeling, I frequently don\'t know the answer.","scoreAgree":[5,4,3,2,1]},{"id":2,"text":"I\'m unsure of which words to use when describing my feelings.","scoreAgree":[5,4,3,2,1]},{"id":3,"text":"I prefer to find out the emotional intricacies of my problems rather than just describe them in terms of practical facts.","scoreAgree":[1,2,3,4,5]},{"id":4,"text":"When other people are hurt or upset, I have difficulty imagining what they are feeling.","scoreAgree":[5,4,3,2,1]},{"id":5,"text":"People tell me to describe my feelings more, as if I haven\'t elaborated enough.","scoreAgree":[5,4,3,2,1]},{"id":6,"text":"Sex as a recreational activity seems kinda pointless.","scoreAgree":[5,4,3,2,1]},{"id":7,"text":"I can describe my emotions with ease.","scoreAgree":[1,2,3,4,5]},{"id":8,"text":"You cannot functionally live your life without being aware of your deepest emotions.","scoreAgree":[1,2,3,4,5]},{"id":9,"text":"People sometimes get upset with me, and I can\'t imagine why.","scoreAgree":[5,4,3,2,1]},{"id":10,"text":"People tell me I don\'t listen to their feelings properly, when in fact I\'m doing my utmost to understand what they\'re saying!","scoreAgree":[5,4,3,2,1]},{"id":11,"text":"When I am upset I find it difficult to identify the feelings causing it.","scoreAgree":[5,4,3,2,1]},{"id":12,"text":"Describing the feelings I have about other people is often difficult.","scoreAgree":[5,4,3,2,1]},{"id":13,"text":"I prefer doing physical activities with friends rather than discussing each others’ emotional experiences.","scoreAgree":[5,4,3,2,1]},{"id":14,"text":"I am not much of a daydreamer.","scoreAgree":[5,4,3,2,1]},{"id":15,"text":"I don\'t like people\'s constant assumptions that I should understand or guess their needs... it\'s as if they want me to read their minds!","scoreAgree":[5,4,3,2,1]},{"id":16,"text":"I sometimes experience confusing sensations in my body.","scoreAgree":[5,4,3,2,1]},{"id":17,"text":"For me sex is more a functional activity than it is an emotional one.","scoreAgree":[5,4,3,2,1]},{"id":18,"text":"Some people have told me I am cold or unresponsive to their needs.","scoreAgree":[5,4,3,2,1]},{"id":19,"text":"I don\'t dream frequently, and when I do the dreams usually seem rather boring.","scoreAgree":[5,4,3,2,1]},{"id":20,"text":"Friends have indicated, in one way or another, that I\'m more in my head than in my heart.","scoreAgree":[5,4,3,2,1]},{"id":21,"text":"I can\'t identify feelings that I vaguely sense are going on inside of me.","scoreAgree":[5,4,3,2,1]},{"id":22,"text":"I often ask other people what they would feel if in my personal situation (any situation), as this better helps me understand what to do.","scoreAgree":[5,4,3,2,1]},{"id":23,"text":"I find it useful to ponder on my feelings as much as the practical issues when setting my priorities.","scoreAgree":[1,2,3,4,5]},{"id":24,"text":"I use my imagination mainly for practical means, eg., like how to work out a problem or construct a useful idea or object.","scoreAgree":[5,4,3,2,1]},{"id":25,"text":"I often feel incompetent, awkward, uncomfortable, or occasionally physically sick in sexual situations.","scoreAgree":[5,4,3,2,1]},{"id":26,"text":"When involved in difficult or turbulent relationships, I sometimes develop confusing physical symptoms.","scoreAgree":[5,4,3,2,1]},{"id":27,"text":"I tend to rely on other people for interpreting the emotional details of personal/social events.","scoreAgree":[5,4,3,2,1]},{"id":28,"text":"I don’t like conversations in which more time is spent discussing emotional matters than daily activities because it detracts from my enjoyment.","scoreAgree":[5,4,3,2,1]},{"id":29,"text":"I often get confused about what the other person wants from a sexual relationship.","scoreAgree":[5,4,3,2,1]},{"id":30,"text":"People I\'ve been in close relationships with have complained that I neglect them emotionally.","scoreAgree":[5,4,3,2,1]},{"id":31,"text":"I like it when someone describes the feelings they experience under circumstances similar to my own, because this helps me see what my own feelings might be.","scoreAgree":[5,4,3,2,1]},{"id":32,"text":"My imagination is often spontaneous, unpredictable and involuntary.","scoreAgree":[1,2,3,4,5]},{"id":33,"text":"When helping others I prefer to assist with physical tasks rather than offering counsel about their feelings.","scoreAgree":[5,4,3,2,1]},{"id":34,"text":"I have puzzling physical sensations that even friends/aquaintances/others don\'t understand.","scoreAgree":[5,4,3,2,1]},{"id":35,"text":"I get in a muddle when I try to describe how I feel about an important event.","scoreAgree":[5,4,3,2,1]},{"id":36,"text":"My imagination is usually not spontaneous and surprising, but rather used/employed in a more controlled fashion.","scoreAgree":[5,4,3,2,1]},{"id":37,"text":"I make decisions based on principles rather than gut feelings.","scoreAgree":[5,4,3,2,1]}],"degree":{"agree":"Strongly Agree","disagree":"Strongly Disagree"},"scores":[{"title":"Scoring","subtitle":"Score"}],"result":[{"text":"No alexithymia"},{"text":"Possible alexithymia"},{"text":"Alexithymia present"}]}')}}]);